sources.styles/blocks/_container.scss:
.container {
  margin: 0 auto;
  max-width: 1200px;
  padding: 0 28px;

  @include onTablet {
    padding: 0 36px;
  }

  &--features {
    padding: 0;

    @include onTablet {
      padding: 0 36px;
    }
  }
}

sources.styles/utils/_mixins.scss:
@mixin onDesktop {
  @media (min-width: em(1200)) {
    @content;
  }
}

@mixin onTablet {
  @media (min-width: em(836)) {
    @content;
  }
}

@mixin onMobile {
  @media (min-width: em(480)) {
    @content;
  }
}

@mixin h2 {
    font-size: clamp(40px, 4.3vw, 62px);
    line-height: clamp(52px, 5.4vw, 78px);
    font-weight: 700;
    text-transform: uppercase;
    color: $c-black;
    margin-bottom: 20px;
}

sources.styles/blocks/_header.scss:
.header {
  padding-top: 30px;
  margin-bottom: 60px;

  &__top {
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-bottom: clamp(20px, 6.2vw, 90px);
  }

  &__list {
    display: none;
    justify-content: space-between;
    align-items: center;
    gap: 28px;

    @include onTablet {
      display: flex;
    }
  }

  &__item {
    color: $c-dark-gray;
  }

  &__content {
    margin-bottom: clamp(110px, 11.8vw, 170px);

    @include onTablet {
      display: flex;
      flex-direction: row-reverse;
      justify-content: center;
      align-items: center;
    }
  }

  &__title {
    @include h2;
  }

  &__text {
    flex: 1 1 30%;
  }

  &__info {
    font-size: rem(16);
    line-height: 150%;
    color: $c-black;
  }

  &__image {
    object-fit: cover;
    overflow: hidden;
    max-width: 100%;
  }
}

