sources.styles/blocks/_btn-secondary.scss:
.button-secondary {

  &__homepage {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 48px;
    font-size: rem(12);
    text-transform: uppercase;
    line-height: 15px;
    color: $c-green;
    font-weight: 500;
    border: 1px solid $c-green;
    padding: 0 53px;
    transition: all 0.3s ease 0s;

    &:hover {
      background-color: $c-dark-green;
      border: none;
      color: $c-white;
    }
  }

  &__add-card {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 48px;
    font-size: rem(12);
    text-transform: uppercase;
    line-height: 18px;
    color: $c-black;
    font-weight: 500;
    border: 1px solid $c-black;
    padding: 0 53px;
    transition: all 0.3s ease 0s;

    &:hover {
      background-color: $c-dark-black;
      border: none;
      color: $c-white;
    }
  }

  &__about {
    position: relative;
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 48px;
    font-size: rem(12);
    text-transform: uppercase;
    line-height: 15px;
    color: $c-green;
    font-weight: 500;
    padding: 0 53px;
    transition: all 0.3s ease 0s;

    &::after {
      content: "";
      position: absolute;
      top: 100%;
      left: 50%;
      transform: translateX(-50%);
      height: 1px;
      width: 50%;
      background-color: $c-green;
    }

    &:hover::after {
      width: 100%;
    }
  }

  &__return-card {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 48px;
    font-size: rem(12);
    text-transform: uppercase;
    line-height: 14px;
    color: $c-dark-gray;
    font-weight: 500;
    padding: 0 53px;
    transition: all 0.3s ease 0s;

    &:hover {
      border: 1px solid $c-dark-gray;
    }
  }
}

