sources.styles/blocks/_menu.scss:
.menu {
  padding: 30px 0;
  height: 100%;
  backdrop-filter: blur(10px);

  position: fixed;
  left: 0;
  right: 0;
  top: 0;
  transform: translateY(-100%);
  transition: all 0.3s ease 0s;

  &:target {
    transform: translateY(0);
    z-index: 2;
  }

  &__top {
    display: flex;
    justify-content: space-between;
    align-items: center;
  }

  &__list {
    margin-top: 30px;
    display: flex;
    flex-direction: column;
    gap: 20px;
  }

  &__item {
    cursor: pointer;
  }
}

sources.styles/blocks/_icon.scss:
.icon {
  display: block;
  height: 25px;
  width: 25px;
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
  cursor: pointer;

  @include onTablet {
