sources.styles/blocks/_nav.scss:
.nav {


  &__list {
    display: none;
    justify-content: space-evenly;

    @include onDesktop {
    display: flex;
    }

  }

  &__link {
    position: relative;

    &::before {
      content: "";
      position: absolute;
      top: 36px;
      height: 2px;
      width: 0;
      background-color: $c-green;
      transition: width 0.3s;
    }

    &:hover {
      transform: scale(1.1);
    }

    &:hover::before {
      width: 100%;
    }
  }
