sources.styles/blocks/_cards.scss:
.cards {
  margin-bottom: clamp(50px, 14vw, 170px);

  &__icon {
    margin-bottom: 33px;
    height: 50px;
    width: 50px;
    transition: transform 0.3s;

    @include onTablet {
      &:hover {
        transform: scale(1.1);
      }
    }
  }

  &__title {
    height: 56px;
    margin-bottom: 24px;
    font-weight: 700;
    font-size: rem(22);
    line-height: 28px;
    text-transform: uppercase;
    color: $c-dark-gray;
    text-align: center;
  }

  &__text {
    text-align: center;
    font-size: rem(14);
    line-height: 21px;
    color: $c-gray;
  }

  &__swiper {
    box-sizing: border-box;
    width: 100%;
    z-index: 0;
    padding: 0 28px;
    height: 360px;
  }

  .swiper-pagination-bullet {
    background-color: $c-green;
    font-size: rem(20);
  }

  &__swiper-slide {
    display: flex;
    flex-direction: column;
    align-items: center;
    text-align: center;
  }

  @include onMobile {
    &__swiper {
      display: none;
    }
  }

  &__content {
    display: none;

    @include onMobile {
      display: grid;
      grid-template-columns: repeat(2, 1fr);
      gap: 64px 20px;
    }

    @include onDesktop {
      display: flex;
      justify-content: space-between;
    }
  }

  &__block {
    flex: 25%;
    display: flex;
    flex-direction: column;
    align-items: center;
    transition: transform 0.3s;

    @include onTablet {

      &:hover {
        transform: scale(1.05);
      }
    }
  }
}

sources.styles/blocks/_about-us.scss:
.about-us {
  margin-bottom: clamp(50px, 13.5vw, 162px);

  &__block {
    &:first-child {
      margin-bottom: clamp(50px, 12vw, 140px);
    }

    @include onTablet {
      display: grid;
      grid-template-columns: repeat(2, 1fr);
      grid-template-rows: auto auto 1fr;
      gap: 0 20px;
    }

    @include onDesktop {
      gap: 0 30px;
    }
  }

  &__button {
    display: block;
    max-width: fit-content;
    grid-column: 2 / 3;
    grid-row: 3 / 4;

    color: $c-dark-green;
    font-weight: 700;
    font-size: rem(12);
    line-height: 14px;
    text-transform: uppercase;

    &--eye {
      grid-column: 1 / 2;
    }

    &::after {
      content: "";
      display: block;
      transform: translateY(7px);
      height: 1px;
      width: 64px;
      background-color: $c-dark-green;

      transition: width 0.3s;
    }

    &:hover::after {
      width: 100%;
    }

    @include onTablet {
      margin-bottom: 40px;
    }
  }

  &__info {
    grid-column: 2 / 3;
    grid-row: 2 / 3;
    margin-bottom: 30px;
    font-size: 14px;
    line-height: 21px;
    color: $c-gray;

    &--eye {
      grid-column: 1 / 2;
    }

    @include onTablet {
      margin-bottom: 60px;
      font-size: rem(16);
      line-height: 24px;
    }
  }

  &__title {
    @include h2;
    grid-column: 2 / 3;
    grid-row: 1 / 2;

    &--eye {
      grid-column: 1 / 2;
    }
  }

  &__photo {
    grid-column: 1 / 2;
    grid-row: 1 / 4;
    margin-bottom: 20px;
    overflow: hidden;

    &--eye {
      grid-column: 2 / 3;
    }

    @include onTablet {
      margin: 0;
    }
  }

  &__image {
    width: 100%;
    height: 100%;
    object-fit: cover;

    transition: transform 0.3s;

    &:hover {
      transform: scale(1.2);
    }
  }
}

sources.styles/blocks/_quote.scss:
