sources.styles/blocks/_features.scss:
.features {
  margin-bottom: clamp(50px, 13.5vw, 162px);

  &__content {
    position: relative;
    padding: 32px 32px 174px;
    background-color: #d6ecec;

    @include onTablet {
      padding: 60px 90px 224px;
    }

    @include onDesktop {
      max-width: 1200px;
      padding: 60px 100px;
    }
  }

  &__title {
    @include h2;
    padding: 0 36px;

    @include onTablet {
      padding: 0;
    }
  }

  &__subtitle {
    font-weight: 700;
    font-size: 18px;
    line-height: 22px;
    color: $c-dark-green;
    margin-bottom: 20px;

    @include onDesktop {
      font-size: 34px;
      line-height: 42px;
    }
  }

  &__list {
    padding: 0 16px;
    margin-bottom: 48px;
  }

  &__item {
    font-size: 14px;
    line-height: 21px;
    color: $c-dark-gray;
    margin-bottom: 10px;

    @include onDesktop {
      font-size: 16px;
      line-height: 24px;
    }
  }

  &__swiper {
    @include onDesktop {
      display: none;
    }
  }

  &__swiper-elements {
    display: flex;
    justify-content: center;
    margin-bottom: 8px;

    @include onTablet {
      justify-content: start;
    }
  }

  &__swiper-button-next {
    cursor: pointer;
    width: 48px;
    height: 14px;
    background-image: url(../images/icons/slider-right.svg);
    background-repeat: no-repeat;
    background-position: 50% 50%;
    transition: all 0.3s ease 0s;

    &:hover {
      background-image: url(../images/icons/arrow-right-green.svg);
    }
  }

  &__swiper-button-prev {
    cursor: pointer;
    width: 48px;
    height: 14px;
    background-image: url(../images/icons/slider-left.svg);
    background-repeat: no-repeat;
    background-position: left;
    transform: translateY(2px);
    transition: all 0.3s ease 0s;

    &:hover {
      background-image: url(../images/icons/arrow-left-green.svg);
    }
  }

  &__icon {
    font-size: 14px;
    color: $c-dark-gray;

    &::before {
      color: $c-dark-gray;
      cursor: pointer;
      transition: color 0.3s;
    }

    &:hover::before {
      color: $c-dark-green;
    }
  }

  &__swiper-pagination {
    display: flex;
    gap: 3px;
    justify-content: center;
    font-size: 11px;
    line-height: 13px;
    color: $c-dark-green;
    transform: translateY(8px);

    @include onTablet {
      width: max-content;
      transform: translate(28px, 8px);
    }
  }


  .swiper-pagination-current {
    font-size: 16px;
    line-height: 24px;
    color: $c-dark-gray;
    transform: translateY(-10px);

    &::before {
      content: "0";
    }
  }

  .swiper-pagination-total {
    &::before {
      content: "0";
    }
  }

  &__image {
    position: absolute;
    bottom: 0;
    right: 8px;
    height: 174px;

    @include onTablet {
      height: 224px;
    }

    @include onDesktop {
      height: 302px;
      right: 48px;
    }
  }

  &__wrapper {
    display: none;

    @include onDesktop {
      display: flex;
      flex-wrap: wrap;
      gap: 60px 100px;
    }
  }
}

